import styled from "styled-components";
import React from "react";

export default () => {
  return <Wrapper></Wrapper>;
};

const SticyNavStyle = {
  display: "flex",
  justifyContent: "space-between",
  position: fixed,
  padding: "60 60 0",
};

function StickyNav() {
  return <nav style={SticyNavStyle}></nav>;
}

export const Wrapper = styled.main`
  position: fixed;
  left: 0;
  right: 0;
  bottom: 0;
  top: 0;
  background-color: #fafafa;
`;
